import React from "react";
import { Container, Form, Card, Button, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import { REGISTRATION_ROUTE } from "../utils/constantes.tsx";

const LoginPage = () => {
  return (
    <Container className="d-flex justify-content-center align-items-center mt-5">
      <Card style={{ width: 600 }} className="p-5">
        <h2 className="m-auto">Log In</h2>
        <Form className="d-flex flex-column">
          <Form.Control placeholder="Enter your Email" className="mt-3" />
          <Form.Control placeholder="Enter your Password" className="mt-3" />
          <Row className="d-flex justify-content-between mt-3">
            <div>
              No Account? <NavLink to={REGISTRATION_ROUTE}>Register</NavLink>
            </div>
            <Button variant={"outline-dark"} className="mt-3 align-self-end">
              Log In
            </Button>
          </Row>
        </Form>
      </Card>
    </Container>
  );
};

export default LoginPage;
